import React from "react";
import styles from './Tasks.module.css'


function Tasks(props) {
    return (
        <div className={styles.tasks}>
          <div className={styles.tskType}>
            <h3 className={styles.headtask}>Task Type:</h3>
            <h3>{props.type}</h3>
        </div>
          
          <div className={styles.taskTitle}>Priority:</div>
          <div className={`${styles.taskDetail} ${styles.priority}`}>{props.priority}</div>
          
          <div className={styles.taskTitle}>Customer:</div>
          <div className={styles.taskDetail}>{props.customer}</div>
          
          <div className={styles.taskTitle}>Service:</div>
          <div className={styles.taskDetail}>{props.service}</div>
        </div>
      );
}

export default Tasks;
